  false,\n\t\"url\": null,\n\t\"notes\": \"Note: Renewable energy production as a
  percentage of the total annual energy use by Austin Energy customers rnrnThe Austin
  Energy Resource & Climate Protection Plan approved by the Austin City Council in
  2010 set a target of achieving 35% renewable resources by 2020. This includes 200
  megawatts of solar capacity and 1,000 megawatts of wind power. During fiscal year
  2012, about 15% of the power delivered from Austin Energy to its customers came
  from renewable resources. Purchase power agreements for wind, solar and biomass
  power will bring our renewable portfolio to 23% by the end of 2013.rnrnIn June 2013
  the Austin City Council approved three new wind contracts totaling 570 megawatts
  which will put the utility four years ahead of schedule for achieving its 35% renewable
  energy resources goal by 2020. Those new wind projects will come online between
  2014 and 2016.rnrnAustin Energy's first utility-scale solar facility known as the
  Webberville Solar Project began producing electricity in December 2011. The utility
  is purchasing all of the electricity produced from the 30-megawatt facility over
  the next 25 years. Austin Energy is also purchasing all power generated from a 100-megawatt
  biomass plant which went online in June 2012 (20-year contract).\",\n\t\"license_title\":
